import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  container: {
    background: 'blue',
    color: 'white',
    padding: '5em',
    borderRadius: '50px',
    width: '300px',
    maxWidth: '300px',
    margin: '2em',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  },
  input: {
    border: 'none',
    outline: 'none',

    background: '#7c7c7c2b',
    color: 'white',
    fontFamily: 'inherit',
    fontSize: '130%',

  },
  button: {
    backgroundColor: '#3498db',
    padding: 10,
    borderRadius: 5,
  },
  buttonText: {
    color: '#fff',
    textAlign: 'center',
    fontWeight: 'bold',
  },
});
